import { link } from 'fs';
import React from 'react';
import ReactDom from 'react-dom';
import 'semantic-ui-css/semantic.min.css'
import Body from './player';

//our page


class App extends React.Component {

    render(props) {
        return (
            <div>
                <Body />
            </div>
        )
    };
};


ReactDom.render(<App />, document.getElementById('root'));
